import React from "react";
import "../styles/Home.css"; // Import CSS file
// import WallPaper from "../images/Home_WallPaper.png";
import { useNavigate } from "react-router-dom";

export default function Home() {
    const navigate = useNavigate();

    function GameJoin() {
        navigate('/join');
    }

    return (
        <div className="container-fluid bg-image1 text-center">
            <div className="row">
                <div className="fixed-bottom mb-5 pb-5">
                    <button className="start-button" onClick={GameJoin}>Let's Start</button>

                </div>

                <input type="button">Lets start</input>
            </div> 


            <div className="fixed-bottom">
                <footer className="text-body-secondary text-center text-small mt-md-5">
                    <p className="mb-1">© 2023–2024 GameJHU</p>
                </footer>
            </div>

        </div>
    );
}
